A strip club is a world unlike any other. Go behind the scenes in that world with some of the most controversial employees around - strippers. Director Jill Morley became a stripper, and, as only an insider can, obtained full access. She set out to capture this life on film by profiling other dancers and revealing the inner workings of exotic dance, getting unexpected results and, unfortunately, documented the tragic fate of some of the girls.
